function Prac(props) {
    return (
        <div>
            <h2>hello</h2>
            {props.data.map((item, i) => {
                return (
                    <h3 key={i}>{item}</h3>
                )
            })}
            <select>
                <option>1</option>
                <option>2</option>
                <option>3</option>
                <option>4</option>
                <option>5</option>
            </select>
        </div>

    )
}
